"ui";

ui.layout(
    <vertical >
        <text text="此脚本运行需要无障碍服务权限" size="20" />
        <button ayout_gravity="right" id="check_authority" text="开启无障碍服务权限" />

        <text text="脚本运行后需要手动切换到如下界面:" size="20" />

        <horizontal>

            <img src="data:image/jpeg;base64," />
















            <img src="data:image/jpeg;base64," />
        </horizontal>

        <checkbox layout_gravity="left" id="full_function_enable" text="自动切换界面(如果不稳定请取消勾选)" checked="false" size="16" />

        <vertical layout_gravity="right|bottom" w="auto" h="auto">
            <button id="runner_tb" text="淘宝领喵币" />
            <button id="runner_jd" text="京东领金币" />
        </vertical>

    </vertical>
);

ui.full_function_enable.on('check', (checked) => {
    thread = threads.start(function () {
        if (checked) {
            toast('当前仅淘宝能自动切换')
            sleep(2000)
            toast('京东如有需要请反馈')
            sleep(1000)
        }
    })
})

ui.check_authority.on("click", () => {
    thread = threads.start(function () {
        try {
            auto()
            toastLog('无障碍服务权限已取得')
            //threads.currentThread().interrupt()
        } catch (error) {
            toastLog('小米等机型是在 更多已下载的服务 中进行授权')
            sleep(3000)
            toast('请找到对应名称的服务并开启')
            sleep(2000)
        }

    })
})

ui.runner_tb.on("click", () => {
    auto()
    thread = threads.start(function () {


        if (ui.full_function_enable.checked) {
            toastLog('开始自动打开界面')

            try {
                app.startActivity({
                    packageName: 'com.taobao.taobao',
                    className: 'com.taobao.tao.TBMainActivity'
                })

                // 等待主界面,最多等10s
                for (var i = 0; i < 10; i++) {
                    if (currentActivity() != 'com.taobao.tao.TBMainActivity') {
                        smartClick(textContains('跳过').findOne(1000))
                        sleep(1000)
                    }
                }

                if (currentActivity() != 'com.taobao.tao.TBMainActivity') {
                    // 黑屏等特殊状况 重试一次
                    launchApp('手机淘宝')
                    sleep(10000)
                    if (currentActivity() != 'com.taobao.tao.TBMainActivity') {
                        console.error('failed to launch application')
                        toast('fatal error　: failed to launch application')
                        exit()
                    }
                }
                sleep(1000); // 延时 确保各控件弹窗等加载完成

                // 防止更新等弹窗扰乱程序
                if (text('取消').exists()) {
                    smartClick(text('取消').findOne(1000))
                    sleep(1000)
                }

                smartClick(desc('首页').findOne(1000))
                sleep(1000)
                var p = desc('主会场').findOne(1000).bounds()
                click(p.centerX() + device.width / 2, p.centerY())
                sleep(5000)
                if (!text('待兑换红包').exists())
                    sleep(5000)
                smartClick(textContains('收下').findOne(1000))
                smartClick(textContains('上限').findOne(1000))
                sleep(1000)
                click(device.width * 0.85, 1750)
                sleep(1000)
            } catch (error) {
                toastLog('自动打开界面出现错误 现在请手动打开')
                sleep(2000)
                toastLog('错误详情:' + error.message)
            }
        }
        else {
            toast('请手动切换到对应界面')
        }

        for (var i = 0; i < 10; i++) {
            if (currentActivity() != 'com.taobao.browser.BrowserActivity') {
                sleep(1000)
            }
        }
        sleep(5000)
        toastLog('开始领喵币')
        auto_click_tb()
        toastLog('领喵币已结束')
    })
})

ui.runner_jd.on("click", () => {
    auto()
    thread = threads.start(function () {
        if (ui.full_function_enable.checked) {
            toast('此功能待开发中 现在请手动切换')
        } else {
            toast('请手动切换到对应界面')
        }

        for (var i = 0; i < 10; i++) {
            if (currentActivity() != 'com.jingdong.app.mall.WebActivity')
                sleep(1000)
        }
        sleep(3000)
        toast('开始领金币')
        auto_click_jd()
        toast('领金币已结束')
    })

})

function auto_click_tb() {
    smartClick(text('签到').findOne(1000))
    smartClick(desc('签到').findOne(1000))

    for (var i = 0; i < 30 && text('去进店').exists(); i++) {
        if (smartClick(text('去进店').findOne(1000))) {
            sleep(3000)
            swipe(540, 1500, 540, 500, 500)
            sleep(18000)
            back()
            sleep(3000)
        }
    }

    for (var i = 0; i < 30 && text('去浏览').exists(); i++) {
        if (smartClick(text('去浏览').findOne(1000))) {
            sleep(3000)
            swipe(540, 1500, 540, 500, 500)
            sleep(18000)
            back()
            sleep(3000)
        }
    }

}

